  false,\n\t\"url\": null,\n\t\"notes\": \"Numerous researchers have demonstrated
  that shot from shotgun shells which is lodged in the tissue of ducks, can be used
  as an indicator of hunting pressure or the vulnerability of various species to hunting.
  The technique most often used to detect the presence of body shot is x-ray fluoroscopy.
  Relatively little fluoroscopy has been conducted for body shot in diving ducks.
  The objectives of this study were to determine the incidence of body shot in canvasbacks
  from selected migrational and wintering areas, and to detect variations in the vulnerability
  of canvasbacks in regard to age and sex of the birds, location of the birds, and
  time of the hunting season.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
